import React from 'react'
import About from './About'
import MainBanner from './MainBanner'
import NavBar from './NavBar'

export default function Portfolio() {
    return (
        <div id="portfolio">
            <NavBar />
            <MainBanner />
            <About />
        </div>
    )
}
